(908, 1, '2017-07-11 08:54:31', '2017-07-11 08:54:31', '<img src=\"http://localhost/wp-construction/wp-content/uploads/elementor/thumbs/Logo-obrnl5fw0b8gco1cuu931oeit2xxqozi66siu6lwrk.png\" title=\"Logo\" alt=\"Logo\" />											\n			<h1>We Design, Estimate and Built</h1>		\n			Our goal then and now is to provide quality on time projects		\n			<a href=\"contact-us/\" role=\"button\">\n						Get free quote\n					</a>\n			<a href=\"contact-us/\" role=\"button\">\n						Get in touch\n					</a>\n			<h3>Welcome to the yokota construction company</h3>		\n			<h4>Where we build your visions</h4>		\n		<p>Write a warm welcoming message for visitors.You can mention all the benefits or services with some real examples. You can also state how you emphasize on their well being. This often shows your concern and increases the chances of conversion. </p><p>Tell people a little more to attract.You can mention some contact details as shown below to get in touch with visitors.</p>		\n			<h5>Call us today: </h5>		\n			<h2>(046) 472-1904</h2>		\n										<img width=\"800\" height=\"600\" src=\"http://localhost/wp-construction/wp-content/uploads/2019/08/45091037_306753673253796_4061554785743011840_n.jpg\" alt=\"\" srcset=\"http://localhost/wp-construction/wp-content/uploads/2019/08/45091037_306753673253796_4061554785743011840_n.jpg 800w, http://localhost/wp-construction/wp-content/uploads/2019/08/45091037_306753673253796_4061554785743011840_n-300x225.jpg 300w, http://localhost/wp-construction/wp-content/uploads/2019/08/45091037_306753673253796_4061554785743011840_n-768x576.jpg 768w\" sizes=\"(max-width: 800px) 100vw, 800px\" />											\n			<h2>Our specialization</h2>		\n		<p>You can use these sections to highlight the features of heading. Use these paragraphs to focus on the topic you want. Make sure you keep it short and attractive.</p> 		\n			<figure><img width=\"40\" height=\"37\" src=\"http://localhost/wp-construction/wp-content/uploads/2019/08/construction-icon04-1.png\" alt=\